import React, { useState } from 'react';
import { Box, Paper } from '@mui/material';
import { Link, useLocation } from 'react-router-dom';

const Sidebar = () => {
  const location = useLocation();

  const menuItems = [
    { 
      path: '/', 
      icon: '/static/images/carrer_nav.jpeg',
      text: 'Manual Prediction', 
      alt: 'Karriere Navigation'
    },
    { 
      path: '/linkedin', 
      icon: '/static/images/linkedin_nav.jpg',
      text: 'LinkedIn Prediction',
      alt: 'LinkedIn Navigation'
    },
    { 
      path: '/batch', 
      icon: '/static/images/candi_batch_nav.jpg',
      text: 'Batch Upload',
      alt: 'Batch Navigation'
    },
    { 
      path: '/candidates', 
      icon: '/static/images/candidates.png',
      text: 'Candidates',
      alt: 'Kandidaten Navigation'
    }
  ];

  const bottomButtons = [
    { icon: '/static/images/settings.svg', alt: 'Einstellungen' },
    { icon: '/static/images/info.svg', alt: 'Info' },
    { icon: '/static/images/plus.svg', alt: 'Hinzufügen' },
    { icon: '/static/images/arrow.svg', alt: 'Weiter' },
  ];

  return (
    <Paper
      elevation={3}
      sx={{
        position: { xs: 'fixed', md: 'fixed' },
        top: { xs: 0, md: 0 },
        left: { xs: 0, md: 0 },
        width: { xs: '100vw', md: '260px' },
        height: { xs: 'auto', md: '100vh' },
        minHeight: { xs: '64px', md: '100vh' },
        bgcolor: '#fff',
        borderRadius: 0,
        boxShadow: '0 8px 32px rgba(0,0,0,0.08)',
        zIndex: 1000,
        overflow: 'hidden',
        display: 'flex',
        flexDirection: { xs: 'row', md: 'column' },
        justifyContent: { xs: 'flex-start', md: 'space-between' },
        alignItems: { xs: 'center', md: 'stretch' },
        border: 'none',
        gap: 2,
      }}
    >
      {/* Logo-Bereich */}
      <Box sx={{
        width: { xs: 'auto', md: '100%' },
        display: 'flex',
        flexDirection: { xs: 'row', md: 'column' },
        alignItems: 'center',
        pt: { xs: 0, md: 2.5 },
        pb: { xs: 0, md: 2 },
        gap: { xs: 2, md: 0 },
      }}>
        <a 
          href="https://www.aurio.ai/de/"
          target="_blank" 
          rel="noopener noreferrer"
          style={{ textDecoration: 'none' }}
        >
          <img 
            src="/static/images/logo.png"
            alt="Aurio Technology Logo"
            style={{ width: '60px', height: 'auto', marginBottom: 0, marginRight: 8}}
          />
        </a>
        <a 
          href="https://www-mis.ur.de/master" 
          target="_blank" 
          rel="noopener noreferrer"
          style={{ textDecoration: 'none' }}
        >
          <img 
            src="/static/images/ur-logo.png"
            alt="UR Logo"
            style={{ width: '60px', height: 'auto', marginBottom: 0}}
          />
        </a>
      </Box>
      {/* Navigation */}
      <Box sx={{
        flex: 1,
        display: 'flex',
        flexDirection: { xs: 'row', md: 'column' },
        gap: { xs: 0.5, md: 1 },
        alignItems: 'center',
        justifyContent: { xs: 'center', md: 'flex-start' },
        width: { xs: 'auto', md: '100%' },
        mt: { xs: 0, md: 2 },
      }}>
        {menuItems.map((item) => (
          <Box
            key={item.path}
            component={Link}
            to={item.path}
            sx={{
              display: 'flex',
              flexDirection: 'column',
              alignItems: 'center',
              justifyContent: 'center',
              textDecoration: 'none',
              bgcolor: location.pathname === item.path ? 'rgba(255,128,0,0.08)' : 'transparent',
              borderRadius: "12px",
              py: { xs: 1, md: 2.5 },
              px: { xs: 1.5, md: 0 },
              width: { xs: 'auto', md: '100%' },
              transition: 'background 1.2s',
              '&:hover': {
                bgcolor: 'rgba(255,128,0,0.13)',
              },
              mt: { xs: 0, md: 0.5 },
            }}
          >
            <img
              src={item.icon}
              alt={item.alt}
              style={{
                width: 32,
                height: 32,
                objectFit: 'contain',
                marginBottom: 0,
              }}
            />   
            <Box
              sx={{
                color: location.pathname === item.path ? '#FF8000' : '#222',
                fontWeight: 600,
                fontSize: '0.80rem',
                textAlign: 'center',
                whiteSpace: 'nowrap',
                letterSpacing: 0.2,
                mt: 0.2,
              }}
            >
              {item.text}
            </Box>
          </Box>
        ))}
      </Box>
    </Paper>
  );
};

export default Sidebar;
